import React, {useState} from 'react';

const Increment: React.FC = () => {
    const [count, setCount] = useState(10);

    return <React.Fragment>
        <button onClick={() => setCount(c => c + 1)}>+</button>
        <button>-</button>
        {count}
    </React.Fragment>
};

export default Increment;
